import React from "react";
import "../card/card.styles.css";

export const Card = (props) => {
	const { id, name, email } = props.monster;

	return (
		<div className="card-container">
			<img src={`https://robohash.org/${id}?set=set2`} alt="monster" />
			<h1>{name}</h1>
			<p>{email}</p>
		</div>
	);
};
